import { NavLink } from "react-router-dom";
import styles from "./styles.module.css";

const Navigation = () => {
	const handleLogout = () => {
        navigate("/");
    };
    return (
        <div className={styles.nav_links_container}>
            <div className={styles.nav_links}>
                <NavLink to="/" className={({ isActive }) => isActive ? `${styles.nav_link} ${styles.active}` : styles.nav_link}>
                    DashBoard
                </NavLink>
                <NavLink to="/Income" className={({ isActive }) => isActive ? `${styles.nav_link} ${styles.active}` : styles.nav_link}>
                    Income
                </NavLink>
                <NavLink to="/Expenses" className={({ isActive }) => isActive ? `${styles.nav_link} ${styles.active}` : styles.nav_link}>
                    Expenses
                </NavLink>
                <NavLink to="/SavingInvestment" className={({ isActive }) => isActive ? `${styles.nav_link} ${styles.active}` : styles.nav_link}>
                    Saving & Investment
                </NavLink>
            </div>
        </div>
    );
};

export default Navigation;
